import {BrowserRouter, Route, Switch} from 'react-router-dom';
import './style/style.css';
function App() {
  return (
    <BrowserRouter>
    <div className="Logo container-fluid p-0">


    <Navigation/>

<BrowserRouter>
    <Switch>

      <Route path='./' component={Home} exact />
